import React, { useState } from "react";
import styled from "styled-components";
import { CardDeck, Card } from "react-bootstrap";
const Styles = styled.div`
  width: 1000px;
`;
export const Home = () => {
  return (
    <Styles>
      <CardDeck>
        <Card style={{ width: "18rem" }}>
            <Card.Title>
              <strong>Exterior Estimates</strong>
            </Card.Title>
          <Card.Body>
            <Card.Text>
              Create Estiamte for Exterior Project
            </Card.Text>
          </Card.Body>
        </Card>
      </CardDeck>
    </Styles>
  );
};
